import { makeAutoObservable } from 'mobx';
import React from 'react';

export interface ICataloge {

    id: number;
    name: string;
    uuid_1c: string;
    deleted?: boolean;
}

class CatalogeStore {

    _cataloges!: ICataloge[];

    constructor() {
        this._cataloges = [{ id: 0, name: '', uuid_1c: '' }];
        // this._cataloges = [{}];
        makeAutoObservable(this);
    }

    set(cataloges: ICataloge[]) {
        this._cataloges = cataloges;
    }
    get cataloges(): ICataloge[] {
        return this._cataloges;
    }

}

export default CatalogeStore;
